import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Toolbar from '@material-ui/core/Toolbar'; 
import FacebookIcon from '@material-ui/icons/Facebook';
import InstagramIcon from '@material-ui/icons/Instagram';
import EmailIcon from '@material-ui/icons/Email';
import SettingsIcon from '@material-ui/icons/Settings';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid'

const useStyles = makeStyles({
    social_btn:{
        color:'white',
    },
    nav_btn:{
        color:'white'
    }
})

export default function Navbar() {
    const classes = useStyles();

    return (
        <AppBar>
            <Toolbar>
                <Typography variant='h3'>Justin's Fishing</Typography>
                <Button className={classes.nav_btn}>Fish/Tips</Button>
                <Button className={classes.nav_btn}>Photos</Button>
                <Button className={classes.nav_btn}>About Justin</Button>
                <Button className={classes.nav_btn}>Contact</Button>
                <Button>
                    <FacebookIcon className={classes.social_btn}/>
                </Button>
                <Button>
                    <InstagramIcon className={classes.social_btn}/>
                </Button>
                <Button>
                    <EmailIcon className={classes.social_btn}/>
                </Button>
                <Button>
                    <SettingsIcon className={classes.social_btn}/>
                </Button>
            </Toolbar>
        </AppBar>
    )
}
